import React from 'react';

const BugSubmit: React.FC = () => (
  <div>
    <h1 className="text-3xl font-bold text-gray-900 mb-6">Submit Bug Report</h1>
    <div className="card">
      <p className="text-gray-600">Bug submission form to be implemented</p>
    </div>
  </div>
);

export default BugSubmit;
